import React, { useEffect, useState } from "react";

function App() {
  const [cars, setCars] = useState([]);
  const [form, setForm] = useState({ name: "", brand: "", price: "", available: true });

  // Fetch cars
  useEffect(() => {
    fetch("http://localhost:8080/api/cars")
      .then((res) => res.json())
      .then((data) => setCars(data))
      .catch((err) => console.error("Error fetching cars:", err));
  }, []);

  // Handle form change
  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({
      ...form,
      [name]: type === "checkbox" ? checked : value,
    });
  };

  // Add car
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:8080/api/cars", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(form),
      });
      const newCar = await response.json();
      setCars([...cars, newCar]);
      setForm({ name: "", brand: "", price: "", available: true });
    } catch (error) {
      console.error("Error adding car:", error);
    }
  };

  return (
    <div style={{ padding: "20px", fontFamily: "sans-serif" }}>
      <h1>üöó Car Rental - Manage Cars</h1>

      {/* Add Car Form */}
      <form onSubmit={handleSubmit} style={{ marginBottom: "20px" }}>
        <input
          type="text"
          name="name"
          placeholder="Car Name"
          value={form.name}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="brand"
          placeholder="Brand"
          value={form.brand}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="price"
          placeholder="Price"
          value={form.price}
          onChange={handleChange}
          required
        />
        <label>
          <input
            type="checkbox"
            name="available"
            checked={form.available}
            onChange={handleChange}
          />
          Available
        </label>
        <button type="submit">Add Car</button>
      </form>

      {/* Car List */}
      <h2>Available Cars</h2>
      <ul>
        {cars.map((car) => (
          <li key={car.id}>
            {car.name} ({car.brand}) - ‚Çπ{car.price}{" "}
            {car.available ? "‚úÖ Available" : "‚ùå Not Available"}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
